      this.gl.texImage2D(this.gl.TEXTURE_CUBE_MAP_NEGATIVE_Z, 0, this.gl.RGBA, this.gl.RGBA, this.gl.UNSIGNED_BYTE, this.skyboxCanvas)

      this.gl.generateMipmap(this.gl.TEXTURE_CUBE_MAP)

