    if (!this.gl.getProgramParameter(this.shadowProgram, this.gl.LINK_STATUS)) console.log(`Unable to initialize the shadow shader program: ${this.gl.getProgramInfoLog(this.shadowProgram)}`)
  
    let shadowVSize = 3;

